import React from 'react';
import { Container, Row, Col, Card, Cardbody, Cardtext } from 'react-bootstrap';
import './Rolled.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

const Rolled = ({text, rolling}) => {
  return (
    <Container>
      <Row className="justify-content-center">
        <Col xs={9} lg={6}>
          <Card className="mt-4 rollCard">
            <CardBody>
              {rolling ?
                <CardText className="rollingIcon rollText"><FontAwesomeIcon icon="skull" /></CardText> :
                <CardText className="rollText">{text}</CardText>
              }
            </CardBody>
            
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default Rolled;
